INSERT INTO `wp_posts` VALUES (1,1,'2017-08-28 08:27:58','2017-08-28 08:27:58','Welcome to WordPress. This is your first post. Edit or delete it, then start writing!','Hello world!','','publish','open','open','','hello-world','','','2017-08-29 09:58:38','2017-08-29 09:58:38','',0,'http://localhost/wordpress/?p=1',0,'post','',1),(2,1,'2017-08-28 08:27:58','2017-08-28 08:27:58','This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\n\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</blockquote>\n\n...or something like this:\n\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\n\nAs a new WordPress user, you should go to <a href=\"http://localhost/wordpress/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!','Sample Page','','publish','closed','open','','sample-page','','','2017-08-28 08:27:58','2017-08-28 08:27:58','',0,'http://localhost/wordpress/?page_id=2',0,'page','',0),(3,1,'2017-08-28 08:28:32','0000-00-00 00:00:00','','Auto Draft','','auto-draft','open','open','','','','','2017-08-28 08:28:32','0000-00-00 00:00:00','',0,'http://localhost/wordpress/?p=3',0,'post','',0),(6,1,'2017-08-28 10:24:17','2017-08-28 10:24:17','<img class=\"alignnone size-full wp-image-5\" src=\"http://localhost/wordpress/wp-content/uploads/2017/08/fleur.jpg\" alt=\"\" width=\"1024\" height=\"768\" />Welcome to WordPress. This is your first post. Edit or delete it, then start writing!','Hello world!','','inherit','closed','closed','','1-autosave-v1','','','2017-08-28 10:24:17','2017-08-28 10:24:17','',1,'http://localhost/wordpress/index.php/2017/08/28/1-autosave-v1/',0,'revision','',0),(7,1,'2017-08-28 10:29:23','0000-00-00 00:00:00','','Auto Draft','','auto-draft','closed','closed','','','','','2017-08-28 10:29:23','0000-00-00 00:00:00','',0,'http://localhost/wordpress/?page_id=7',0,'page','',0),(8,1,'2017-08-28 10:34:23','0000-00-00 00:00:00','','Espresso','','auto-draft','open','closed','','','','','2017-08-28 10:34:20','0000-00-00 00:00:00','',0,'http://localhost/wordpress/wp-content/uploads/2017/08/espresso.jpg',0,'attachment','image/jpeg',0),(9,1,'2017-08-28 10:34:23','0000-00-00 00:00:00','','Sandwich','','auto-draft','open','closed','','','','','2017-08-28 10:34:21','0000-00-00 00:00:00','',0,'http://localhost/wordpress/wp-content/uploads/2017/08/sandwich.jpg',0,'attachment','image/jpeg',0),(10,1,'2017-08-28 10:34:23','0000-00-00 00:00:00','','Coffee','','auto-draft','open','closed','','','','','2017-08-28 10:34:21','0000-00-00 00:00:00','',0,'http://localhost/wordpress/wp-content/uploads/2017/08/coffee.jpg',0,'attachment','image/jpeg',0),(11,1,'2017-08-28 10:34:23','0000-00-00 00:00:00','Welcome to your site! This is your homepage, which is what most visitors will see when they come to your site for the first time.','Home','','auto-draft','closed','closed','','','','','2017-08-28 10:34:21','0000-00-00 00:00:00','',0,'http://localhost/wordpress/?page_id=11',0,'page','',0),(12,1,'2017-08-28 10:34:23','0000-00-00 00:00:00','You might be an artist who would like to introduce yourself and your work here or maybe you&rsquo;re a business with a mission to describe.','About','','auto-draft','closed','closed','','','','','2017-08-28 10:34:21','0000-00-00 00:00:00','',0,'http://localhost/wordpress/?page_id=12',0,'page','',0),(13,1,'2017-08-28 10:34:23','0000-00-00 00:00:00','This is a page with some basic contact information, such as an address and phone number. You might also try a plugin to add a contact form.','Contact','','auto-draft','closed','closed','','','','','2017-08-28 10:34:22','0000-00-00 00:00:00','',0,'http://localhost/wordpress/?page_id=13',0,'page','',0),(14,1,'2017-08-28 10:34:23','0000-00-00 00:00:00','','Blog','','auto-draft','closed','closed','','','','','2017-08-28 10:34:22','0000-00-00 00:00:00','',0,'http://localhost/wordpress/?page_id=14',0,'page','',0),(15,1,'2017-08-28 10:34:23','0000-00-00 00:00:00','This is an example of a homepage section. Homepage sections can be any page other than the homepage itself, including the page that shows your latest blog posts.','A homepage section','','auto-draft','closed','closed','','','','','2017-08-28 10:34:22','0000-00-00 00:00:00','',0,'http://localhost/wordpress/?page_id=15',0,'page','',0),(16,1,'2017-08-28 10:34:23','0000-00-00 00:00:00','{\n    \"widget_text[2]\": {\n        \"starter_content\": true,\n        \"value\": {\n            \"encoded_serialized_instance\": \"\",\n            \"title\": \"Find Us\",\n            \"is_widget_customizer_js_value\": true,\n            \"instance_hash_key\": \"28253fa00f8d9dc3557d0225b408d380\"\n        },\n        \"type\": \"option\",\n        \"user_id\": 1\n    },\n    \"widget_search[3]\": {\n        \"starter_content\": true,\n        \"value\": {\n            \"encoded_serialized_instance\": \"YToxOntzOjU6InRpdGxlIjtzOjY6IlNlYXJjaCI7fQ==\",\n            \"title\": \"Search\",\n            \"is_widget_customizer_js_value\": true,\n            \"instance_hash_key\": \"794b004f25e75e6671961e5bed2045f1\"\n        },\n        \"type\": \"option\",\n        \"user_id\": 1\n    },\n    \"widget_text[3]\": {\n        \"starter_content\": true,\n        \"value\": {\n            \"encoded_serialized_instance\": \"YTo0OntzOjU6InRpdGxlIjtzOjE1OiJBYm91dCBUaGlzIFNpdGUiO3M6NDoidGV4dCI7czo4NToiVGhpcyBtYXkgYmUgYSBnb29kIHBsYWNlIHRvIGludHJvZHVjZSB5b3Vyc2VsZiBhbmQgeW91ciBzaXRlIG9yIGl